# ==============================================================================
# ‚è±Ô∏è Time Utilities
# ==============================================================================
class TimeConverter:
    """Utility class to convert times between seconds and HH:MM:SS format."""
    
    @staticmethod
    def hms_to_seconds(time_str: str) -> float:
        """Converts time string (HH:MM:SS) to total seconds."""
        try:
            parts = time_str.split(":")
            if len(parts) == 3:
                h = int(parts[0])
                m = int(parts[1])
                s = float(parts[2])
                return h * 3600 + m * 60 + s
        except ValueError:
            # Handle non-integer parts or missing parts gracefully within the check
            pass
        except IndexError:
            # Handle cases where split parts are unexpected
            pass
            
        raise ValueError("Invalid time format. Must be HH:MM:SS")
    
    @staticmethod
    def seconds_to_hms(seconds: float) -> str:
        """Converts total seconds to HH:MM:SS format string."""
        h = int(seconds // 3600)
        m = int((seconds % 3600) // 60)
        s = int(seconds % 60)
        return f"{h:02d}:{m:02d}:{s:02d}"

# ==============================================================================
# üìΩÔ∏è Video Information Model
# ==============================================================================
class VideoInfo:
    """Data model to hold loaded video information."""
    def __init__(self, path: str, duration: float):
        self.path = path
        self.duration = duration
    
    @property
    def filename(self):
        """Returns the base filename of the video path."""
        return Path(self.path).name
    
    @property
    def duration_hms(self):
        """Returns the duration in HH:MM:SS format."""
        return TimeConverter.seconds_to_hms(self.duration)

# ==============================================================================
# üßµ FFmpeg Worker (QThread Worker)
# ==============================================================================
class FfmpegWorker(QObject):
    """
    Worker object to run FFmpeg/FFprobe operations in a separate QThread.
    Handles 'load' (ffprobe) and 'cut' (ffmpeg) modes.
    """
    
    finished = Signal(object) # Emits VideoInfo on load, or success message on cut
    error = Signal(str)      # Emits error message string
    
    def __init__(self, mode, path=None, start=None, end=None, output=None, video_info=None):
        super().__init__()
        self.mode = mode
        self.path = path
        self.start = start
        self.end = end
        self.output = output
        self.video_info = video_info

    @Slot()
    def run(self):
        """Main execution method for the thread worker."""
        if self.mode == "load":
            self._load_video()
        elif self.mode == "cut":
            self._cut_video()

    def _load_video(self):
        """Uses ffprobe to extract video duration."""
        try:
            # Command to get duration in seconds
            cmd = [
                'ffprobe', '-v', 'error', '-show_entries', 'format=duration',
                '-of', 'default=noprint_wrappers=1:nokey=1', self.path
            ]
            
            result = subprocess.run(
                cmd, capture_output=True, text=True, timeout=10,
                # Setting check=True raises CalledProcessError for non-zero exit codes
                creationflags=subprocess.CREATE_NO_WINDOW, check=True
            )
            
            duration = float(result.stdout.strip())
            info = VideoInfo(path=self.path, duration=duration)
            self.finished.emit(info)
        except subprocess.CalledProcessError as e:
            error_msg = e.stderr if e.stderr else "Failed to connect to ffprobe."
            self.error.emit(f"FFmpeg/ffprobe not installed or not found in PATH.\n\n{error_msg}")
        except Exception as e:
            self.error.emit(f"Failed to load video information.\n\nError: {str(e)}")

    def _cut_video(self):
        """Uses ffmpeg to cut the video segment."""
        try:
            duration = self.end - self.start
            # -ss before -i for fast seeking, -c copy avoids re-encoding
            cmd = [
                'ffmpeg', '-ss', str(self.start), '-i', self.video_info.path,
                '-t', str(duration), '-c', 'copy', self.output, '-y' # -y to overwrite
            ]
            
            subprocess.run(
                cmd, capture_output=True, text=True, check=True,
                creationflags=subprocess.CREATE_NO_WINDOW
            )
            
            self.finished.emit("‚úÖ Cutting successful!")
        except subprocess.CalledProcessError as e:
            error_details = e.stderr if e.stderr else f"Unknown error (Code: {e.returncode})"
            self.error.emit(f"Video cutting failed.\n\nError details:\n{error_details}")
        except Exception as e:
            self.error.emit(f"General cutting error: {str(e)}")

# ==============================================================================
# ‚úÇÔ∏è Main Application Window (QMainWindow)
# ==============================================================================
class VideoCutter(QMainWindow):
    """The main window of the Video Cutter application."""
    
    def __init__(self):
        super().__init__()
        
        self.setWindowTitle("Simple Video Cutter (FFmpeg)")
        self.setGeometry(100, 100, 550, 500)
        self.setMinimumSize(500, 450)
        
        # Internal state
        self.video_info: VideoInfo = None
        self.last_output: str = None
        self.thread: QThread = None  
        self.worker: FfmpegWorker = None  
        
        self.setWindowIcon(self._get_icon()) 
        self.setAcceptDrops(True) # Enable drag and drop
        
        self._build_ui()
        self._setup_connections()
    
    # --- UI Setup ---
    
    def _get_icon(self) -> QIcon:
        """Load icon from embedded Base64 data if available."""
        try:
            if ICON_BASE64_DATA:
                icon_data = base64.b64decode(ICON_BASE64_DATA)
                pixmap = QPixmap()
                pixmap.loadFromData(QByteArray(icon_data), "PNG") 
                return QIcon(pixmap)
            return QIcon()
        except Exception:
            return QIcon()

    def _build_ui(self):
        """Initializes and lays out the user interface elements."""
        
        central_widget = QWidget()
        self.setCentralWidget(central_widget)
        main_layout = QVBoxLayout(central_widget)
        
        # Header Section
        header_label = QLabel("üé¨ Video Cutter")
        header_label.setFont(QFont("Segoe UI", 18, QFont.Bold))
        main_layout.addWidget(header_label, alignment=Qt.AlignCenter)
        
        subheader_label = QLabel("Cut videos easily and quickly using FFmpeg")
        subheader_label.setFont(QFont("Segoe UI", 9))
        subheader_label.setStyleSheet("color: gray;")
        main_layout.addWidget(subheader_label, alignment=Qt.AlignCenter)
        
        # --- Content Area ---
        content_widget = QWidget()
        content_layout = QVBoxLayout(content_widget)
        content_layout.setContentsMargins(20, 15, 20, 15)
        main_layout.addWidget(content_widget, stretch=1) 
        
        # Video Selection Section (Drop Area)
        self.drop_label = QLabel("üé•\n\nDrag video here\nor click to select")
        self.drop_label.setAlignment(Qt.AlignCenter)
        self.drop_label.setFrameShape(QFrame.Box)
        self.drop_label.setStyleSheet("""
            QLabel { 
                border: 2px dashed #00BFFF; 
                border-radius: 8px; 
                padding: 20px;
                font-size: 12pt;
                font-weight: bold;
                color: #00BFFF;
            }
        """)
        self.drop_label.setCursor(Qt.PointingHandCursor)
        # Connect click event to file dialog
        self.drop_label.mousePressEvent = lambda event: self._select_video()
        content_layout.addWidget(self.drop_label, stretch=4)
        
        self.video_info_label = QLabel("")
        self.video_info_label.setFont(QFont("Segoe UI", 9))
        content_layout.addWidget(self.video_info_label, alignment=Qt.AlignCenter)
        
        # Time Input Section (Grid Layout)
        time_grid = QGridLayout()

        self.start_entry = QLineEdit("00:00:00")
        self.end_entry = QLineEdit("00:00:00")
        self.duration_label = QLabel("00:00:00")
        
        elements = [
            ("üü¢ Start", "#28a745", self.start_entry),
            ("üî¥ End", "#dc3545", self.end_entry),
            ("üìè Cut Duration", "#17a2b8", self.duration_label)
        ]
        
        for i, (text, color, widget) in enumerate(elements):
            label = QLabel(text)
            label.setAlignment(Qt.AlignCenter)
            time_grid.addWidget(label, 0, i, alignment=Qt.AlignCenter)
            
            if isinstance(widget, QLineEdit):
                widget.setAlignment(Qt.AlignCenter)
                widget.setFont(QFont("Segoe UI", 11, QFont.Bold))
                time_grid.addWidget(widget, 1, i)
            else:
                widget.setAlignment(Qt.AlignCenter)
                widget.setFont(QFont("Segoe UI", 11, QFont.Bold))
                widget.setStyleSheet(f"color: {color};")
                time_grid.addWidget(widget, 1, i, alignment=Qt.AlignCenter)
                
        content_layout.addLayout(time_grid)
        
        # Visual Progress Bar (representing cut duration)
        self.visual_progress = QProgressBar()
        self.visual_progress.setTextVisible(False)
        self.visual_progress.setMaximum(100)
        self.visual_progress.setValue(0)
        content_layout.addWidget(self.visual_progress)
        
        # Cut Button
        self.cut_button = QPushButton("‚úÇÔ∏è Cut Video")
        self.cut_button.setEnabled(False)
        self.cut_button.setStyleSheet("padding: 10px; font-size: 14pt; background-color: #28a745; color: white;")
        content_layout.addWidget(self.cut_button)
        
        # Progress bar (during cutting/loading)
        self.progress_bar = QProgressBar()
        self.progress_bar.setRange(0, 0) # Indeterminate progress
        self.progress_bar.hide()
        content_layout.addWidget(self.progress_bar)
        
        # Footer
        self.status_label = QLabel("üëÜ Select a video")
        self.status_label.setFont(QFont("Segoe UI", 8))
        self.status_label.setStyleSheet("color: gray;")
        main_layout.addWidget(self.status_label, alignment=Qt.AlignCenter)

    def _setup_connections(self):
        """Connects signals to slots."""
        self.cut_button.clicked.connect(self._start_cutting)
        self.start_entry.textChanged.connect(self._update_duration)
        self.end_entry.textChanged.connect(self._update_duration)

    # --- Drag & Drop and File Selection Handlers ---
    
    def dragEnterEvent(self, event):
        """Accepts drag events if URLs are present."""
        if event.mimeData().hasUrls():
            event.accept()
        else:
            event.ignore()

    def dropEvent(self, event):
        """Processes dropped file URLs."""
        for url in event.mimeData().urls():
            file_path = url.toLocalFile()
            if os.path.isfile(file_path):
                # Basic check for common video extensions
                if file_path.lower().endswith(('.mp4', '.avi', '.mkv', '.mov', '.flv', '.wmv')):
                    self._load_video(file_path)
                else:
                    QMessageBox.warning(self, "‚ùå Error", "Unsupported file format! Please drop a video file.")
                return # Process only the first valid file

    def _select_video(self):
        """Opens a file dialog to select a video."""
        path, _ = QFileDialog.getOpenFileName(
            self, "Select Video File", "", 
            "Video Files (*.mp4 *.avi *.mkv *.mov *.flv *.wmv);;All Files (*.*)"
        )
        if path:
            self._load_video(path)

    # --- Video Loading (FFprobe) ---
    
    def _load_video(self, path: str):
        """Starts the worker thread to load video info using ffprobe."""
        self.status_label.setText("‚è≥ Loading video details...")
        self.progress_bar.show()
        
        # Setup QThread and FfmpegWorker
        self.thread = QThread()
        self.worker = FfmpegWorker(mode="load", path=path)
        self.worker.moveToThread(self.thread)
        
        # Connect signals
        self.thread.started.connect(self.worker.run)
        self.worker.finished.connect(self._on_video_loaded)
        self.worker.error.connect(self._handle_error)
        
        # Cleanup connections
        self.worker.finished.connect(self.thread.quit)
        self.worker.error.connect(self.thread.quit)
        self.thread.finished.connect(self.thread.deleteLater)
        self.worker.finished.connect(self.worker.deleteLater)
        
        self.thread.start()

    @Slot(object)
    def _on_video_loaded(self, info: VideoInfo):
        """Handles the successful loading of video information."""
        self.video_info = info
        filename = info.filename
        
        self.progress_bar.hide()
        
        # Update UI with video details
        self.drop_label.setText(f"‚úÖ Loaded: {filename}")
        self.drop_label.setStyleSheet("border: 2px solid #28a745; font-weight: bold; color: #28a745;")
        self.video_info_label.setText(f"üìπ {filename} | ‚è±Ô∏è Total Duration: {info.duration_hms}")
        
        # Set End time to total duration
        self.end_entry.setText(info.duration_hms)
        self.cut_button.setEnabled(True)
        self.status_label.setText("‚úÖ Ready to cut")
        self._update_duration()

    # --- Video Cutting (FFmpeg) ---

    @Slot()
    def _start_cutting(self):
        """Initiates the video cutting process."""
        if not self.video_info:
            QMessageBox.warning(self, "‚ö†Ô∏è Warning", "Please select a video file first!")
            return
        
        # 1. Validate and convert time inputs
        try:
            start = TimeConverter.hms_to_seconds(self.start_entry.text())
            end = TimeConverter.hms_to_seconds(self.end_entry.text())
        except ValueError as e:
            QMessageBox.critical(self, "‚ùå Error", f"Invalid time format!\n\nDetails: {str(e)}")
            return
        
        if end <= start:
            QMessageBox.critical(self, "‚ùå Error", "End time must be greater than start time!")
            return
        
        if end > self.video_info.duration:
             QMessageBox.critical(self, "‚ùå Error", "End time exceeds the original video duration!")
             return
        
        # 2. Get output file path
        input_path = Path(self.video_info.path)
        default_file_name = f"{input_path.stem}_cut{input_path.suffix}"
             
        output, _ = QFileDialog.getSaveFileName(
            self, "Save Cut Video File", 
            str(input_path.parent / default_file_name),
            "MP4 Video (*.mp4);;AVI Video (*.avi);;MKV Video (*.mkv);;All Files (*.*)"
        )
        
        if not output:
            return # User cancelled save dialog
        
        if os.path.abspath(output) == os.path.abspath(self.video_info.path):
            QMessageBox.critical(self, "‚ùå Error", "Cannot save the cut file with the same name and path as the original input file.")
            return

        self.last_output = output
        self.cut_button.setEnabled(False)
        self.progress_bar.show()
        self.status_label.setText("‚öôÔ∏è Cutting video segment...")
        
        # 3. Start cutting worker thread
        self.thread = QThread()
        self.worker = FfmpegWorker(
            mode="cut", start=start, end=end, output=output, video_info=self.video_info
        )
        self.worker.moveToThread(self.thread)
        
        # Connect signals (same cleanup pattern as _load_video)
        self.thread.started.connect(self.worker.run)
        self.worker.finished.connect(self._show_success)
        self.worker.error.connect(self._handle_error)
        
        self.worker.finished.connect(self.thread.quit)
        self.worker.error.connect(self.thread.quit)
        self.thread.finished.connect(self.thread.deleteLater)
        self.worker.finished.connect(self.worker.deleteLater)
        
        self.thread.start()

    # --- Utility Slots ---

    @Slot()
    def _update_duration(self):
        """Calculates and updates the duration label and visual progress bar."""
        try:
            start = TimeConverter.hms_to_seconds(self.start_entry.text())
            end = TimeConverter.hms_to_seconds(self.end_entry.text())
            
            # Ensure duration is not negative
            duration = max(0, end - start)
            
            self.duration_label.setText(TimeConverter.seconds_to_hms(duration))
            
            # Update visual progress bar based on total video duration
            if self.video_info and self.video_info.duration > 0:
                pct = (duration / self.video_info.duration) * 100
                self.visual_progress.setValue(min(100, int(pct)))
            else:
                 self.visual_progress.setValue(0)
        except:
            # Display placeholder on invalid time format
            self.duration_label.setText("--:--:--")
            self.visual_progress.setValue(0)

    # --- Feedback and Error Handlers ---

    @Slot(str)
    def _handle_error(self, message: str):
        """Displays a critical error message and resets UI components."""
        self.progress_bar.hide()
        self.cut_button.setEnabled(True)
        self.status_label.setText("‚ùå Operation Failed")
        QMessageBox.critical(self, "‚ùå Operation Error", message)

    @Slot(str)
    def _show_success(self, message: str):
        """Displays a success message and prompts to open the file."""
        self.progress_bar.hide()
        self.cut_button.setEnabled(True)
        self.status_label.setText(message)
        
        reply = QMessageBox.question(
            self, "Success", 
            f"‚úÇÔ∏è Cutting completed successfully!\n\nSaved to: {Path(self.last_output).name}\n\nDo you want to open the file?",
            QMessageBox.Yes | QMessageBox.No
        )
        
        if reply == QMessageBox.Yes:
            try:
                # Open the file using the default system handler
                if sys.platform == "win32":
                    os.startfile(self.last_output)
                elif sys.platform == "darwin": # macOS
                    subprocess.call(["open", self.last_output])
                else: # linux
                    subprocess.call(["xdg-open", self.last_output])
            except:
                QMessageBox.warning(self, "üîç Open File Failed", "Could not open the file using the default system command. Please open it manually.")


if __name__ == "__main__":
    # Ensure FFmpeg/FFprobe binaries are available in PATH for the app to work
    app = QApplication(sys.argv)
    window = VideoCutter()
    window.show()
    sys.exit(app.exec())